const ByeSell = () => {
  return (
    <div
      style={{
        height: "100vh",
        width: "100%",
        background: "gray",
        display: "flex",
        alignItems: "center",
        justifyContent: "center",
      }}
    >
      <div
        style={{
          height: "50%",
          width: "90%",
          background: "white",
          display: "flex",
        }}
      >
        <div
          style={{
            flex: 5,
          }}
        >
          <div style={{ height: "15%", background: "red" }}>Coin Name</div>
          <div style={{ height: "15%", background: "skyblue" }}>
            Buying Amount
          </div>
          <div style={{ height: "15%", background: "red" }}>Selling Amount</div>
          <div style={{ height: "15%", background: "skyblue" }}>
            Grid Amount
          </div>
        </div>
        <div style={{ flex: 5 }}>div_2</div>
      </div>
    </div>
  );
};

export default ByeSell;
